import React, { Fragment } from "react";
class Form extends React.Component {
  render() {
    return (
      <form>
        <label>
          first_name
          <input type="text" name="first_name" />
        </label>
        <label>
          last_name
          <input type="text" name="last_name" />
        </label>
        <label>
          email
          <input type="email" name="email" />
        </label>
        <label>
          password
          <input type="password" name="password" />
        </label>
      </form>
    );
  }
}
export default Form;
